import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="navbar navbar-default bg-dark p-0 m-0">
            <div className="container-fluid p-0 m-0">
                <div className="navbar-header">
                    <a className="navbar-brand" href="#!">JoBuzz</a>
                </div>
                <ul className=" navbar-right d-flex">
                    <li><a href="#!"> <i className="fa fa-user"></i><span> Sign Up</span></a></li>
                    <li><a href="#!"> <i className="fa fa-sign-in"></i><span> Login</span></a></li>
                </ul>
            </div>
        </nav>
    )
}

export default Navbar;
